import React from "react";

function Table(props){
    return (
        <tr id={props.ID} class="border-bottom ">
            <td class="{{props.ID}}" >1</td> {/*id = {props.index}
            {/* <td><img src="/imag/{props.thumbnail}"></td> */}
            <td class="FirstName" ondblclick="update(this, 'FirstName', '{props.ID}', '{props.FirstName}')">{props.FirstName }</td>
            <td class="LastName" ondblclick="update(this, 'LastName', '{props.ID}', '{props.LastName}')">{props.LastName }</td>
            <td class="height" ondblclick="update(this, 'height', '{props.ID}', '{props.height}')">{props.height}</td>

            <td>
                <button class="btn btn-outline-danger" onclick="props.deleteMe('{props.ID}')" ><i class="fa-sharp fa-solid fa-trash"></i></button>
            </td>
        </tr>
    )
}

export default Table;
